import React, { useState, useEffect } from 'react'
import { NavLink } from 'react-router-dom'
import { Menu } from 'antd';
import store from "../redux/store"
import { connect } from 'react-redux'

import { createFetchMenu } from "../redux/count_aciton"
function Side() {
    const [current, setCurrent] = useState('jobManagemen');
    useEffect(() => {
        store.dispatch(createFetchMenu('fetchMenu', current))
    }, [current]);
    return (

        <Menu
            selectedKeys={current}
            style={{
                width: 200,
                height: 'calc(100vh - 60px)',
            }}
            onSelect={(e) => { setCurrent(e.key) }}
            mode="inline"
            theme='dark'
        >
            <Menu.Item key='jobManagemen'>
                <NavLink to='/Detail/jobManagemen'>作业管理</NavLink>
            </Menu.Item>
            <Menu.Item key='explorationProject'>
                <NavLink end to='/Detail/explorationProject'>勘探项目</NavLink>
            </Menu.Item>
        </Menu>
    )
}
export default connect(
    state => ({
        routerMenu: state.routerMenu
    })
)(Side);
